import React from 'react';
import {
    View,
    Text
} from 'react-native';

import Animated from "react-native-reanimated";


const MainLayout = ({ drawerAnimationStyle }) => {
    return (
        <Animated.View
            style={{
                flex: 1,
                alignItems: 'center',
                backgroundColor: 'white',
                justifyContent: 'center'
            }}
        >
            <Text>Main Layout</Text>
        </Animated.View>
    )
}

export default MainLayout;
